import { useLocation } from "react-router-dom";
import React from "react";

function ThePost() {

    const location = useLocation();
    const { postList } = location.state; 

    return (
        <div> {postList.map((post) => {
            return (
                <div> {post.id} </div>
            );
        })} </div>
    );
}

export default ThePost;
